import classes from './Signupmodal.module.css';
import Card from '../UserInterface/Card';
import { Link } from 'react-router-dom';
import { useFormik } from "formik";
import logo from '../../assests/Logo.png';


function Modal(props){
    const click = props.clickButtons;

    const formik = useFormik({
        initialValues: {
            Email: '',
            Password: ''
        },
        onSubmit: values => {
            console.log(values);
        }
    });

    console.log(formik.values);

    return (
        <Card>
        <div className={classes.modal}>
            <p>
                <span>Sign up</span>
                <p>It takes just a minute!</p>
                <span onClick={click}>
                    <img src={logo} width={40} height={40} onClick={click} />
                </span>
            </p>
            <div>
                <form onSubmit={formik.handleSubmit}>
                    <div>
                        <label className={classes.criteria1} htmlFor='email'>Enter your IITG mail-id</label>
                        <br />
                        <input 
                        className={classes.input1} 
                        id='email' 
                        name='Email' 
                        type="email" 
                        placeholder="include@iitg.ac.in" 
                        required 
                        onChange={formik.handleChange}
                        value={formik.values.Email}/>
                    </div>
                    <div>
                        <label className={classes.criteria2} htmlFor='pass'>Enter Password</label>
                        <br />
                        <input 
                        className={classes.input2} 
                        id='pass'
                        name='Password'
                        type="password"
                        placeholder='********'
                        required 
                        onChange={formik.handleChange}
                        value={formik.values.Password}/>
                    </div>
                </form>
            </div>
            <div>
                <button type='submit' className={classes.btn} onClick={click}>Sign Up</button>
            </div>
        </div>
        </Card>
    );
}
 
export default Modal;
